// src/components/RegularHours.js
import React from "react";

const RegularHours = () => {
  const formattedHours = [
    "Monday – Thursday: 8am ET – 7:45pm ET",
    "Friday: 9am ET – 7:45pm ET",
    "Saturday – Sunday: 9am ET – 5:45pm ET",
  ];

  return (
    <div>
      <h3>Regular Customer Service Hours</h3>
      <ul>
        {formattedHours.map((hour, index) => (
          <li key={index}>{hour}</li>
        ))}
      </ul>
    </div>
  );
};

export default RegularHours;
